INSERT INTO `v1_4d3d5110821cf0084a6055880a9bae65f7f28d4654998859095e6299f4d0ba8a` VALUES ("訓練成功、おめでとうございます\n褒めるべき時にはしっかり褒めるのも\n教官の務めですものね。それとも、\n罵られる方が好みですか？　クスクス", "2024/03/31 12:00:00", 100, "2030/12/17 14:59:59", 10142, 100, 10.85, 1, 0.0, 129901, "エリコ", 0.0, 24, 7);
INSERT INTO `v1_4d3d5110821cf0084a6055880a9bae65f7f28d4654998859095e6299f4d0ba8a` VALUES ("厳しい訓練も、終わってみれば\n短く感じるものですわね。\n正直、私は暴れ足りないくらい…\nいえ、何でもありませんわ。クスクス", "2024/03/31 12:00:00", 101, "2030/12/17 14:59:59", 10142, 101, 11.15, 1, 0.0, 129901, "エリコ", 0.0, 24, 2);
INSERT INTO `v1_4d3d5110821cf0084a6055880a9bae65f7f28d4654998859095e6299f4d0ba8a` VALUES ("行く手を阻む忌々しい邪魔者を\n蹴散らして、見事ゴールイン…！\nまるで私とあのおかたの人生を\n象徴するような道のりでした…", "2024/03/31 12:00:00", 102, "2030/12/17 14:59:59", 10142, 102, 6.4, 7, 0.0, 129901, "エリコ", 0.0, 24, 5);
INSERT INTO `v1_4d3d5110821cf0084a6055880a9bae65f7f28d4654998859095e6299f4d0ba8a` VALUES ("まったくもって不甲斐ない結果です\nしかし、挽回の機会はまだありますわ\n次はゴミ虫の地位から脱却できるよう\n死力を尽くしなさい。いいですね？", "2024/03/31 12:00:00", 103, "2030/12/17 14:59:59", 10142, 103, 0.0, 3, 0.0, 129901, "エリコ", 0.0, 24, 3);
INSERT INTO `v1_4d3d5110821cf0084a6055880a9bae65f7f28d4654998859095e6299f4d0ba8a` VALUES ("クスクス…ああご心配なさらず\nなんとも情けない成績を残す輩には\nどんな罰が相応しいか、考えている\nだけですので…クスクスクス", "2024/03/31 12:00:00", 104, "2030/12/17 14:59:59", 10142, 104, 2.43, 2, 0.0, 129901, "エリコ", 0.0, 24, 8);
INSERT INTO `v1_4d3d5110821cf0084a6055880a9bae65f7f28d4654998859095e6299f4d0ba8a` VALUES ("私が教官として認められなければ、\nあのおかたを失望させてしまう…\nそれだけはあってはなりません\nあなた方も、わかっていますわね？", "2024/03/31 12:00:00", 105, "2030/12/17 14:59:59", 10142, 105, 9.08, 4, 0.0, 129901, "エリコ", 0.0, 24, 3);
INSERT INTO `v1_4d3d5110821cf0084a6055880a9bae65f7f28d4654998859095e6299f4d0ba8a` VALUES ("まずまずの結果ではありますが、\nこの程度で満足してもらっては\n困りますわ。エリコ班の一員として、\nより高みを目指していただきますので", "2024/03/31 12:00:00", 106, "2030/12/17 14:59:59", 10142, 106, 0.0, 6, 0.0, 129901, "エリコ", 0.0, 24, 6);
INSERT INTO `v1_4d3d5110821cf0084a6055880a9bae65f7f28d4654998859095e6299f4d0ba8a` VALUES ("私の指導を受けながら、この結果は…\nもっと真剣に考えねばなりませんね\nあなた方が怠けずにいるには、\nどんなしつけが必要かを…クスクス", "2024/03/31 12:00:00", 107, "2030/12/17 14:59:59", 10142, 107, 10.6, 3, 0.0, 129901, "エリコ", 0.0, 24, 8);
INSERT INTO `v1_4d3d5110821cf0084a6055880a9bae65f7f28d4654998859095e6299f4d0ba8a` VALUES ("ひとまず訓練をこなしたご褒美か、\n実力を出しきれたとは言えない罰か…\nみなさんにどちらを与えるべきか\n少し悩む結果ですわね", "2024/03/31 12:00:00", 108, "2030/12/17 14:59:59", 10142, 108, 7.54, 6, 0.0, 129901, "エリコ", 0.0, 24, 4);
INSERT INTO `v1_4d3d5110821cf0084a6055880a9bae65f7f28d4654998859095e6299f4d0ba8a` VALUES ("なかなかいい戦いぶりでしたわ\nこれもあなた方の頑張りと、何より\n優秀な教官である私の教育の賜物\nそうですわね？　クスクスクス…", "2024/03/31 12:00:00", 109, "2030/12/17 14:59:59", 10142, 109, 11.5, 2, 0.0, 129901, "エリコ", 0.0, 24, 7);
INSERT INTO `v1_4d3d5110821cf0084a6055880a9bae65f7f28d4654998859095e6299f4d0ba8a` VALUES ("これだけ進めたのならば合格点ですわ\nでも、もっと高みを目指したいと\n思っているのなら…さらなる訓練にも\n付き合って差し上げましょう", "2024/03/31 12:00:00", 110, "2030/12/17 14:59:59", 10142, 110, 8.83, 2, 0.0, 129901, "エリコ", 0.0, 24, 1);
INSERT INTO `v1_4d3d5110821cf0084a6055880a9bae65f7f28d4654998859095e6299f4d0ba8a` VALUES ("未熟で頼りなかったあなた方が、\n見違えるように成長しました\nなるほど…これこそが、教官冥利に\n尽きるという気持ちなのですね", "2024/03/31 12:00:00", 111, "2030/12/17 14:59:59", 10142, 111, 6.68, 1, 0.0, 129901, "エリコ", 0.0, 24, 2);
INSERT INTO `v1_4d3d5110821cf0084a6055880a9bae65f7f28d4654998859095e6299f4d0ba8a` VALUES ("まさかあなた方が、私の予想すら\n超える力を発揮するとは…驚きました\nもはやゴミ虫などではありません\n一人前の騎士として胸を張りなさい", "2024/03/31 12:00:00", 112, "2030/12/17 14:59:59", 10142, 112, 8.8, 6, 0.0, 129901, "エリコ", 0.0, 24, 2);
INSERT INTO `v1_4d3d5110821cf0084a6055880a9bae65f7f28d4654998859095e6299f4d0ba8a` VALUES ("クスクス、見事な働きです\nみなさんならできると信じていました\n他でもない私の指導を受けた、\nエリコ班の優秀な新兵なのですから", "2024/03/31 12:00:00", 113, "2030/12/17 14:59:59", 10142, 113, 8.9, 2, 0.0, 129901, "エリコ", 0.0, 24, 1);
INSERT INTO `v1_4d3d5110821cf0084a6055880a9bae65f7f28d4654998859095e6299f4d0ba8a` VALUES ("なんてすばらしい成績…！\n今日という日は『あのおかたを想い\nエリコが限界を超えた記念日』として\n歴史に刻まれることでしょう…！", "2024/03/31 12:00:00", 114, "2030/12/17 14:59:59", 10142, 114, 3.7, 2, 0.0, 129901, "エリコ", 0.0, 24, 5);
INSERT INTO `v1_4d3d5110821cf0084a6055880a9bae65f7f28d4654998859095e6299f4d0ba8a` VALUES ("よし、いい訓練になったな\nおまえたちもよく動けてたし、\nちゃんと成長できてると思うぜ\nその調子で頑張れよっ", "2024/03/31 12:00:00", 200, "2030/12/17 14:59:59", 10142, 200, 7.6, 1, 0.0, 129801, "マコト", 0.0, 24, 2);
INSERT INTO `v1_4d3d5110821cf0084a6055880a9bae65f7f28d4654998859095e6299f4d0ba8a` VALUES ("ひとまずゴールおめでとう！\nでも、努力は継続してこそだからな\nおまえたちにやる気があるなら、\n何度だって付き合ってやるよ", "2024/03/31 12:00:00", 201, "2030/12/17 14:59:59", 10142, 201, 2.25, 2, 0.0, 129801, "マコト", 0.0, 24, 1);
INSERT INTO `v1_4d3d5110821cf0084a6055880a9bae65f7f28d4654998859095e6299f4d0ba8a` VALUES ("行軍訓練はこれにて完了！\n…なーんて思ってないよな？\n学んだことが体に染みつくまで\n地道に繰り返すのが練習ってもんさ", "2024/03/31 12:00:00", 202, "2030/12/17 14:59:59", 10142, 202, 3.28, 2, 0.0, 129801, "マコト", 0.0, 24, 1);
INSERT INTO `v1_4d3d5110821cf0084a6055880a9bae65f7f28d4654998859095e6299f4d0ba8a` VALUES ("みんなに無理をさせちまったか…\nでもこれで諦めることはないぜ\n次はきっとうまくいく。そう信じて\n鍛え続ければ、道は開けるはずだ！", "2024/03/31 12:00:00", 203, "2030/12/17 14:59:59", 10142, 203, 2.98, 4, 0.0, 129801, "マコト", 0.0, 24, 1);
INSERT INTO `v1_4d3d5110821cf0084a6055880a9bae65f7f28d4654998859095e6299f4d0ba8a` VALUES ("こいつは悔しい結果だな…\nま、反省点はいろいろあったし\nひとつずつ乗り越えていこう\nあたしたちで力を合わせて、なっ！", "2024/03/31 12:00:00", 204, "2030/12/17 14:59:59", 10142, 204, 3.0, 4, 0.0, 129801, "マコト", 0.0, 24, 1);
INSERT INTO `v1_4d3d5110821cf0084a6055880a9bae65f7f28d4654998859095e6299f4d0ba8a` VALUES ("おまえたちはまだ未熟な訓練兵、\n失敗を必要以上に悔やむことはねえよ\nでも実戦じゃこうはいかないからな\n次は気合を入れ直していけよっ！", "2024/03/31 12:00:00", 205, "2030/12/17 14:59:59", 10142, 205, 10.3, 1, 0.0, 129801, "マコト", 0.0, 24, 2);
INSERT INTO `v1_4d3d5110821cf0084a6055880a9bae65f7f28d4654998859095e6299f4d0ba8a` VALUES ("これがおまえたちの全力？\nいやいや、そんなはずはないよなっ\nおまえらならもっと強くなれる！\nあたしが言うんだ、間違いないぜ！", "2024/03/31 12:00:00", 206, "2030/12/17 14:59:59", 10142, 206, 2.93, 6, 0.0, 129801, "マコト", 0.0, 24, 1);
INSERT INTO `v1_4d3d5110821cf0084a6055880a9bae65f7f28d4654998859095e6299f4d0ba8a` VALUES ("おまえたちの実力を考えりゃ、\nベストを尽くせたとは言えない成績だ\nなら、次やるべきことも決まってる\n気持ちを切り替えて、鍛え直すんだ！", "2024/03/31 12:00:00", 207, "2030/12/17 14:59:59", 10142, 207, 9.3, 3, 0.0, 129801, "マコト", 0.0, 24, 1);
INSERT INTO `v1_4d3d5110821cf0084a6055880a9bae65f7f28d4654998859095e6299f4d0ba8a` VALUES ("まだまだ課題がある内容だったな～\n無駄な動き、判断の遅れ…\nそういうのをしっかり直していけば、\n記録ももっと伸びるはずだっ", "2024/03/31 12:00:00", 208, "2030/12/17 14:59:59", 10142, 208, 6.9, 4, 0.0, 129801, "マコト", 0.0, 24, 1);
INSERT INTO `v1_4d3d5110821cf0084a6055880a9bae65f7f28d4654998859095e6299f4d0ba8a` VALUES ("ここまでいけりゃ、合格点！\nむしろ、最初の頼りなさを思えば\nすげえ成長してるんじゃねえか？\n胸を張れる結果だと思うぜっ！", "2024/03/31 12:00:00", 209, "2030/12/17 14:59:59", 10142, 209, 0.0, 2, 0.0, 129801, "マコト", 0.0, 24, 2);
INSERT INTO `v1_4d3d5110821cf0084a6055880a9bae65f7f28d4654998859095e6299f4d0ba8a` VALUES ("なかなかハードな訓練だったけど、\nみんなしっかりついてこられたな\n地道に続けた基礎トレの成果が\n形になってる、その証だぜっ", "2024/03/31 12:00:00", 210, "2030/12/17 14:59:59", 10142, 210, 5.95, 1, 0.0, 129801, "マコト", 0.0, 24, 2);
INSERT INTO `v1_4d3d5110821cf0084a6055880a9bae65f7f28d4654998859095e6299f4d0ba8a` VALUES ("今回の訓練もよく頑張ったな！\nしっかり休んで次に備えろよ！\nなんつーか、教え子が成長してくのを\n見るのは楽しいもんだな…", "2024/03/31 12:00:00", 211, "2030/12/17 14:59:59", 10142, 211, 6.73, 2, 0.0, 129801, "マコト", 0.0, 24, 1);
INSERT INTO `v1_4d3d5110821cf0084a6055880a9bae65f7f28d4654998859095e6299f4d0ba8a` VALUES ("おまえら、すげえじゃねえか！\nこれならもう、ひよっこ新兵なんて\n言えねえな。きっと騎士団でも\n大活躍間違いなしだぜ！", "2024/03/31 12:00:00", 212, "2030/12/17 14:59:59", 10142, 212, 0.0, 2, 0.0, 129801, "マコト", 0.0, 24, 2);
INSERT INTO `v1_4d3d5110821cf0084a6055880a9bae65f7f28d4654998859095e6299f4d0ba8a` VALUES ("敵との戦い方、状況判断の正確さ\n何より根性…どれも最高だったぞ！\nうかうかしてたら、教官のあたしまで\n追い抜かれちまうかもな…へへっ", "2024/03/31 12:00:00", 213, "2030/12/17 14:59:59", 10142, 213, 6.65, 1, 0.0, 129801, "マコト", 0.0, 24, 2);
INSERT INTO `v1_4d3d5110821cf0084a6055880a9bae65f7f28d4654998859095e6299f4d0ba8a` VALUES ("あたしの指導が良かった？\nいやいや、ここまで強くなれたのは、\n他でもないおまえたち自身が努力した\nおかげだよ。改めて…おめでとうっ！", "2024/03/31 12:00:00", 214, "2030/12/17 14:59:59", 10142, 214, 3.05, 6, 0.0, 129801, "マコト", 0.0, 24, 1);
